import {useState} from 'react';
import useForm from './hooks/useForm';


function App() {
  const [form, setForm] = useForm({
    name: '',
  });

  console.log(form);

  return (
    <form>
      <input 
        name='name' 
        placeholder='Name' 
        value={form.name}
        onChange={setForm}
        />
    </form>
  );
}

export default App;
